import React from 'react';
import { Link } from 'react-router-dom';
import './portfolio.css';
import { IoLogoJavascript, IoLogoNodejs, IoLogoPython } from 'react-icons/io';
import { IoLogoReact, IoLogoFirebase, IoLogoCss3, IoLogoHtml5 } from 'react-icons/io5';
import {
   SiMongodb,
   SiApollographql,
   SiGraphql,
   SiFigma,
   SiAwsamplify
} from 'react-icons/si';

const images = [
   {
      src: 'https://placehold.co/200',
      alt: 'gallery image',
      title: 'Full-Stack Development',
      desc: 'Description of project and technologies used maybe some icons'
   },
   {
      src: 'https://placehold.co/200',
      alt: 'gallery image',
      title: 'User Interface Design',
      desc: 'Description of project and technologies used maybe some icons'
   },
   {
      src: 'https://placehold.co/200',
      alt: 'gallery image',
      title: 'Systems Engineering',
      desc: 'Description of project and technologies used maybe some icons'
   }
];

export default function Portfolio() {
   return (
      <>
         <div class='row row-cols-1 row-cols-md-3 g-1 px-1 mx-5 my-5 mx-md-5 px-md-5'>
            {images.map((img, index) => (
               <div class='col'>
                  <div class='card'>
                     <img className='card-img' src={img.src} alt={img.alt} />
                     <div class='card-img-overlay text-center text-sm-left'>
                        <h5 class='card-title'>{img.title}</h5>
                        <p class='card-text'>
                           <IoLogoNodejs />
                           <IoLogoReact />
                           <SiMongodb />
                           <IoLogoFirebase />
                           <SiGraphql />
                           <SiFigma />
                           <SiAwsamplify />
                        </p>
                     </div>
                  </div>
               </div>
            ))}
         </div>
      </>
   );
}
